import React from 'react';
import logo from "../assets/psychlogo.png";
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className='navbar'>
        <div className="container">
            <div className="logo">
                <img src={logo} alt="Psych Book" />
            </div>
            <div className="links">
                <Link />
            </div>
        </div>
    </div>
  )
}

export default Navbar
